pragma solidity ^0.4.21;
import "./Campaign.sol";

contract CampaignFactory {
    address[] public campaigns;
    function createCampaign(uint _fundCall, uint _timeLock) public returns(address){
        address campaign = address(new Campaign(msg.sender, _fundCall, _timeLock));
        campaigns.push(campaign);
        return campaign;
    }

    function getAllCampaigns() view public returns(address[]) {
        return campaigns;
    }

    function() payable public {}
}
